#define E1_SLOPE 1

static void ptp_set_ptp_volt(struct ptp_det *det)
{
#if SET_PMIC_VOLT
	int i;
	struct ptp_ctrl *ctrl = id_to_ptp_ctrl(det->ctrl_id);

#if E1_SLOPE
	unsigned int gpu_freq;

	for (i = 0; i < det->num_freq_tbl; i++)
		ptp_notice("before det %d %d\n", det->ctrl_id, det->volt_tbl[i]);

	switch (det->ctrl_id) {
	case PTP_CTRL_LITTLE:
	case PTP_CTRL_BIG:
		for (i = 1; i < det->num_freq_tbl; i++)
			det->volt_tbl[i] += (i + 1);

		break;

	case PTP_CTRL_GPU:
		for (i = 0; i < det->num_freq_tbl; i++) {
			gpu_freq = mt_gpufreq_get_frequency_by_level(i);

#ifdef CONFIG_ARM64

			switch (gpu_freq) {
			case GPU_DVFS_FREQ1:	// 689000
				break;

			case GPU_DVFS_FREQ2:	// 546000
				det->volt_tbl[i] += 2;
				break;

			case GPU_DVFS_FREQ3:	// 442000
				det->volt_tbl[i] += 6;
				break;

			case GPU_DVFS_FREQ4:	// 396500
			case GPU_DVFS_FREQ5:	// 338000
				det->volt_tbl[i] += 8;
				break;

			case GPU_DVFS_FREQ6: 	// 299000
				det->volt_tbl[i] += 8;
				break;

			case GPU_DVFS_FREQ7:	// 253500
				det->volt_tbl[i] += 10;
				break;
			}

#else

			switch (gpu_freq) {
			case GPU_DVFS_FREQ1:	// 695500
			case GPU_DVFS_FREQ1_1:	// 650000
				break;

			case GPU_DVFS_FREQ2:	// 598000
			case GPU_DVFS_FREQ2_1:	// 549250
				det->volt_tbl[i] += 2;
				break;

			case GPU_DVFS_FREQ3:	// 494000
			case GPU_DVFS_FREQ3_1:	// 455000
				det->volt_tbl[i] += 6;
				break;

			case GPU_DVFS_FREQ4:	// 396500
				det->volt_tbl[i] += 8;
				break;

			case GPU_DVFS_FREQ5: 	// 299000
				det->volt_tbl[i] += 8;
				break;

			case GPU_DVFS_FREQ6:	// 253500
				det->volt_tbl[i] += 10;
				break;
			}

#endif
		}

		break;
	}

	for (i = 0; i < det->num_freq_tbl; i++)
		ptp_notice("after det %d %d\n", det->ctrl_id, det->volt_tbl[i]);

#endif

	for (i = 0; i < det->num_freq_tbl; i++)
		det->volt_tbl_pmic[i] = clamp(det->volt_tbl[i] + det->volt_offset, det->VMIN, det->VMAX);

	ctrl->volt_update |= PTP_VOLT_UPDATE;
	wake_up_interruptible(&ctrl->wq);
#endif

	FUNC_ENTER(FUNC_LV_HELP);
	FUNC_EXIT(FUNC_LV_HELP);
}

static void ptp_restore_ptp_volt(struct ptp_det *det)
{
#if SET_PMIC_VOLT
	struct ptp_ctrl *ctrl = id_to_ptp_ctrl(det->ctrl_id);

	ctrl->volt_update |= PTP_VOLT_RESTORE;
	wake_up_interruptible(&ctrl->wq);
#endif

	FUNC_ENTER(FUNC_LV_HELP);
	FUNC_EXIT(FUNC_LV_HELP);
}

